import React from 'react';
import Portfolio from './Portfolio';
import SearchBar from './SearchBar';
require('dotenv').config();

const App = () => {
  return (
    <React.Fragment>
      <Portfolio />
      <SearchBar />
    </React.Fragment>
  );
}

export default App;
